INSERT INTO `v1_2a53f33cf66da8769f1f1fdc91acc2e23cd812087fe6030476e85051ec3c837c` VALUES (0.0, 130011, "ミッションねえ……\nちょうどいいや\nどこまで片付けられるか\n賭けをしようじゃないか", "2024/10/31 12:00:00", 3001100, 3001, 2.1, "ヤマト", -416.5, 1, 100, "2030/01/01 14:59:59", 2);
INSERT INTO `v1_2a53f33cf66da8769f1f1fdc91acc2e23cd812087fe6030476e85051ec3c837c` VALUES (0.0, 130011, "他人から言われた任務を\n言われるままにやるなんざ\n性に合わないんだがね……\nま、報酬は貰っとこうか", "2024/10/31 12:00:00", 3001101, 3001, 5.68, "ヤマト", -416.5, 4, 101, "2030/01/01 14:59:59", 2);
INSERT INTO `v1_2a53f33cf66da8769f1f1fdc91acc2e23cd812087fe6030476e85051ec3c837c` VALUES (0.0, 130011, "なんだい？　やれンなら\nとっとと済ませちまいな。\nフブキが早くやることやれ\nってボヤいてたよ。", "2024/10/31 12:00:00", 3001102, 3001, 0.0, "ヤマト", -416.5, 1, 102, "2030/01/01 14:59:59", 1);
INSERT INTO `v1_2a53f33cf66da8769f1f1fdc91acc2e23cd812087fe6030476e85051ec3c837c` VALUES (0.0, 130211, "え～？　ぼくに頼みごと～？\nどうしちゃおっかな～\nちゃんとお願いできたら\n考えてあげよっかな～？", "2024/10/31 12:00:00", 3002100, 3002, 0.0, "フブキ", -416.5, 1, 100, "2030/01/01 14:59:59", 1);
INSERT INTO `v1_2a53f33cf66da8769f1f1fdc91acc2e23cd812087fe6030476e85051ec3c837c` VALUES (0.0, 130211, "ほらほらぁ、これが\n欲しいんでしょ～？\nほんと、しょうがないよね～\nザコおに～いさん♡", "2024/10/31 12:00:00", 3002101, 3002, 0.0, "フブキ", -416.5, 1, 101, "2030/01/01 14:59:59", 1);
INSERT INTO `v1_2a53f33cf66da8769f1f1fdc91acc2e23cd812087fe6030476e85051ec3c837c` VALUES (0.0, 130211, "へえ～、欲しいんだ～？\nぼくのた・い・せ・つ・な・モ・ノ\nあははっ！　なに考えてんの？\nもうへんふしじゃ～んｗ", "2024/10/31 12:00:00", 3002102, 3002, 8.53, "フブキ", -416.5, 5, 102, "2030/01/01 14:59:59", 2);
INSERT INTO `v1_2a53f33cf66da8769f1f1fdc91acc2e23cd812087fe6030476e85051ec3c837c` VALUES (0.0, 130211, "なになに～？　もしかしてまた\nおねだりするつもりなんだ？\nとか言って、ほんとはぼくに\n会いたいだけだったりして～？", "2024/10/31 12:00:00", 3002103, 3002, 5.67, "フブキ", -416.5, 7, 103, "2030/01/01 14:59:59", 1);
INSERT INTO `v1_2a53f33cf66da8769f1f1fdc91acc2e23cd812087fe6030476e85051ec3c837c` VALUES (0.0, 130211, "ザコお兄さんってぇ\n頼み方もワンパなのぉ～？\nもっと必死にならないと\nぼくの心は動かせないよ～？", "2024/10/31 12:00:00", 3002104, 3002, 0.0, "フブキ", -416.5, 1, 104, "2030/01/01 14:59:59", 1);
INSERT INTO `v1_2a53f33cf66da8769f1f1fdc91acc2e23cd812087fe6030476e85051ec3c837c` VALUES (0.0, 130211, "あのさーザコお兄さん、\nな～んか調子乗ってない？\nぼくのこと、なんでもくれる\nチョロいやつとか思ってたりー？", "2024/10/31 12:00:00", 3002300, 3004, 0.0, "フブキ", -416.5, 3, 300, "2030/01/01 14:59:59", 3);
INSERT INTO `v1_2a53f33cf66da8769f1f1fdc91acc2e23cd812087fe6030476e85051ec3c837c` VALUES (0.0, 130211, "ざんね～ん♪\nうざいお兄さんには、もうな～んにもあげませ～ん♡\nほんとなっさけなーい♪\nばいば～い♡", "2024/10/31 12:00:00", 3002400, 3005, 0.0, "フブキ", -416.5, 7, 301, "2030/01/01 14:59:59", 7);
INSERT INTO `v1_2a53f33cf66da8769f1f1fdc91acc2e23cd812087fe6030476e85051ec3c837c` VALUES (0.0, 130211, "きゃはは、ほんと必死～♡\nは～、面白かった。\n笑えたからいいよ～\nそれ、恵んだげる～♪", "2024/10/31 12:00:00", 3003200, 3003, 4.4, "フブキ", -416.5, 2, 200, "2030/01/01 14:59:59", 1);
INSERT INTO `v1_2a53f33cf66da8769f1f1fdc91acc2e23cd812087fe6030476e85051ec3c837c` VALUES (0.0, 130211, "は～、しょうがないな～♡\nザコお兄さんってば\nほんとよわよわで\n情けないよね～ｗ", "2024/10/31 12:00:00", 3003201, 3003, 0.0, "フブキ", -416.5, 7, 201, "2030/01/01 14:59:59", 7);
INSERT INTO `v1_2a53f33cf66da8769f1f1fdc91acc2e23cd812087fe6030476e85051ec3c837c` VALUES (0.0, 130211, "お兄さんってば、ぼくがいないと\nほんとザッコザコだよね～\nもっと感謝しろし～♪", "2024/10/31 12:00:00", 3003202, 3003, 5.6, "フブキ", -416.5, 1, 202, "2030/01/01 14:59:59", 2);
